import React, { useState } from 'react';
import axios from 'axios';
import Head from 'next/head';

import Menu from '../components/Menu';

import {
  Container,
  Jumbotron,
  Button,
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from 'reactstrap';

import 'bootstrap/dist/css/bootstrap.min.css';

import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fas } from '@fortawesome/free-solid-svg-icons';

library.add(fas);

const Home = (data) => (
    <div>
      <Head>
        <title>Home - Degan</title>
        <meta name="description" content="Site de ... sobre ..." />
        <meta name="author" content="Degan" />


      </Head>
      <Menu />      
      <br />
      <Jumbotron fluid className="descr-top">
        <style>{`.descr-top{
            background-color: #000;
            color: #fff;
            padding-top: 150 px;
            padding-bottom: 150px;
            margin-bottom: 0rem !imporant;
          }.inicio-link{
            position: absolute;
            top: -0px;
          }`}</style>
        <Container className="text-center">
          <a name="inicio" className="inicio-link"></a>
          <h2 className="display-4 mb-4">{data.response.home.topTitulo}</h2>
          <p className="lead">This is a simple hero unit, a simple Jumbotron-style component for calling extra attention to featured content or information.</p>
          <hr className="my-2" />
          <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
          <p className="lead">
            <Button outline color="primary" size="lg">ENTRE EM CONTATO</Button>
          </p>
        </Container>
      </Jumbotron>

      <Jumbotron fluid className="servicos">
          <style>{`.servicos{
          margin-bottom: 0rem !imporant;
          background-color: #fff;
          padding-top: 80px;
          padding-bottom: 80px;
          position: relative;          
        }.circulo{
            width: 140px;
            height: 140px;
            background-color: #fed136;
            font-size: 52px;
            padding-top: 24px;
            color: #fff
        }.centralizar{
            margin: 0 auto !important;
            float: none !important;
        }.servico-link{
          position: absolute;
          top: 0px;
        }`}</style>

        <Container className="text-center">
        <a name="servico" className="servico-link" />

          <div>
            <h2 className="display-4">Serviços</h2>
            <p className="lead pd-4">typography and spacing </p>
